    public void getFourWordDay(String endDate,List<String> days){
        SimpleDateFormat sdf = new SimpleDateFormat("yyyy/MM/dd");
        Calendar calendar = Calendar.getInstance();
        List<String> weekendDays = new ArrayList<>();
        weekendDays.add("2019-01-24");
        weekendDays.add("2019-01-23");
        weekendDays.add("2019-01-17");
        weekendDays.add("2019-01-16");
        calendar.setTime(sdf.parse(endDate,new ParsePosition(0)));
        calendar.add(Calendar.DATE,-1);
        if(!weekendDays.contains(sdf.format(calendar.getTime()))){
            days.add(sdf.format(calendar.getTime()));
        }
        if(days.size() == 4){
            return;
        }else {
            getFourWordDay(sdf.format(calendar.getTime()),days);
        }
    }

